import React, {useState} from "react";
import '../css/AuthForm.css'

function AuthForm() {
    const [idValue, setId] = useState("")
    const [authNum, setAuthNum] = useState("")

    const inputAdminId = event => {
        setId(event.target.value)
    }

    const inputAuthNum = event => {
        setAuthNum(event.target.value)
    }

    function authAction() {
        alert("CheckIdValue :: " + idValue)
    }

    return (
        <div className="formBoxDiv">
            <ul className="formBox">
                <li><input value={idValue} onChange={inputAdminId} type="text" placeholder="아이디 입력"/> </li>
                <li><input value={authNum} onChange={inputAuthNum} type="password" placeholder="패스워드 입력"/> </li>
                <li>
                    <button onClick={authAction}>인증번호 보내기</button>
                </li>
            </ul>
        </div>
    )
}

export default AuthForm;
